import styled from 'styled-components';

const Title = styled.h1
    `
        font-size: 20px;
        width: 100px;
        flex: 1;
        margin: 15px 10px;
        text-align: center;

    `;

const Logo = () => {
    return(
        <Title>GroupBuy</Title>
    )
}

export default Logo;
